import React, { Component } from "react";
import PropTypes from "prop-types";
import TopNav from "./presenter";

class Container extends Component {
  scrollToLocation = event => {
    var offset = $("").offset();
    $('html, body').animate({scrollTop : offset.top}, 400);
  }
  
  render() {
    const {isLoggedIn,nickname} = this.props;
    return (
      <TopNav handlelogOut={this.handlelogOut} isLoggedIn={isLoggedIn} nickname={nickname}  {...this.state} handleInputChange={this._handleInputChange} handleSubmit={this._handleSubmit} onKeyPress={this.onKeyPress}  changeAction={this._changeAction}  handleOpenModal={this.handleOpenModal}  handleCloseModal={this.handleCloseModal} onClick={this.onClick} />
    );
  }

}

export default Container;
